query ReplicateCabinetQuery($projectId: ID!, $role: Role!) {
  result: replicateCabinet(projectId: $projectId, role: $role) {
    ...JobFragment
    __typename
  }
}

fragment JobFragment on Job {
  id
  status
  progress
  errors {
    id
    stack
    args
    __typename
  }
  resultId
  createdAt
  updatedAt
  result
  __typename
}
